import React from "react";
import style from "./Home.module.css"; 

const Home = () => {
  return (
    <div className={style.homeContainer}>
      <h1>Bienvenido a mi Portafolio</h1>
      <img src={'https://ddgimgs-f43e.kxcdn.com/224002/ueu0xr_c58f92452cd4126515ce6062d99d94dea1521c1a.jpg} alt="Mi Foto de Perfil" className={style.profileImage'} />
      <p>Aquí encontrarás información sobre mí y mis proyectos.</p>
    </div>
  );
};

export default Home;
